function Menu() {
  return (
    <>
      <Row className="pt-5 text-center">
        <Col>
          <h1>Menu</h1>
        </Col>
      </Row>
      <Row className="text-center">
        <Col>
          <h3>New Game</h3>
        </Col>
      </Row>
      <Row className="text-center">
        <Col>
          <h3>Leaderboard</h3>
        </Col>
      </Row>
    </>
  );
}

export default Menu;
